import React from 'react'

const Index = (props) => {
    return (
        props.updateAction ? <div className="text-right">
            <button onClick={props.addProductType} disabled={props.formValid ? "" : "disabled"} type="submit" className="btn btn-success">
                Хадгалах
          </button>
        </div> : <div>
            <button onClick={props.addProductType} disabled={props.formValid ? "" : "disabled"} type="submit" className="btn btn-primay">
                Өөрчлөлтийг хадгалах
          </button>
        </div>

    );
}

export default Index;
